package com.onyx.libedu.model;import com.onyx.android.sdk.data.model.BaseData;import java.util.Map;/** * Created by ming on 2016/11/1. */public class Question extends BaseData {    private int difficult;    private Map<String, String> questionOptions;    private int answerCount = 1;    private String stem;    private QuestionAnalytical questionAnalytical;    public int getDifficult() {        return difficult;    }    public void setDifficult(int difficult) {        this.difficult = difficult;    }    public Map<String, String> getQuestionOptions() {        return questionOptions;    }    public void setQuestionOptions(Map<String, String> questionOptions) {        this.questionOptions = questionOptions;    }    public int getAnswerCount() {        return answerCount;    }    public void setAnswerCount(int answerCount) {        this.answerCount = answerCount;    }    public String getStem() {        return stem;    }    public void setStem(String stem) {        this.stem = stem;    }    public QuestionAnalytical getQuestionAnalytical() {        return questionAnalytical;    }    public void setQuestionAnalytical(QuestionAnalytical questionAnalytical) {        this.questionAnalytical = questionAnalytical;    }}